import React from "react";

const Applicants = ({ applicants }) => {
  console.log(applicants);
  return (
    <div>
      <div>
        <div
          className="uk-child-width-1-1 uk-child-width-1-3@l uk-child-width-1-2@s uk-grid-match"
          data-uk-grid
        >
          {applicants &&
            applicants.map((item) => {
              return <p>{item}</p>;
            })}
        </div>
      </div>
    </div>
  );
};

export default Applicants;
